INSERT INTO `page_data` (`id`, `page_id`, `content`, `created_at`, `updated_at`)
VALUES
	(1,1,'<!-- hero-header 11 -->\n<section class=\"w3l-cover-3\" style=\"\n    position: relative;\n    background-color: #fbfaff;\n\">\n    <div class=\"cover top-bottom\" style=\"\n    width: 100%;\n    top: 50%;\n    position: absolute;\n    margin-top: -10%;\n\">\n        <div class=\"wrapper\">\n            <div class=\"middle-section text-center\">\n                <div class=\"section-width\">\n                    <h2>从概念到现实<br>\n                        <strong>将创意与市场营销和<br>技术相融合以推动业务增长</strong>\n                    </h2>\n                </div>\n            </div>\n        </div>\n    </div>\n    <video class=\"banner-background\" src=\"http://demo.copyf.com/3/image/banner12.mp4\" autoplay=\"true\" style=\"width:100%;  \" loop=\"true\" poster=\"\" muted=\"\">\n        <source src=\"http://demo.copyf.com/3/image/banner12.mp4\" type=\"video/mp4\">\n    </video>\n</section><!-- //hero-header 11 -->\n\n<!-- calltoaction-20 -->\n<section class=\"w3l-call-to-action-20\">\n	<div class=\"calltoaction-20\">\n		<div class=\"wrapper\">\n			<div class=\"calltoaction-20-content d-grid\">\n				<img src=\"assets/images/main.jpg\" class=\"img-responsive\" alt=\"\" />\n				<div class=\"column center-align-self\">\n					<h3>找五秒就成功了一半</h3>\n					<p>五秒科技始于 2015 年，以小程序开发、微网站开发、网站建设、电子商务为核心业务，专注于界面设计、技术研发、品牌营销，为客户提供一站式互联网解决方案，努力为客户创造最大的价值， 从而实现自身价值</p>\n					<a href=\"about.html\" class=\"actionbg\">了解五秒</a>\n				</div>\n			</div>\n		</div>\n	</div>\n</section>\n<!-- //calltoaction-20 -->\n\n<!-- services 1-->\n<section class=\"w3l-services-1\">\n	<div class=\"services1\">\n		<div class=\"wrapper\">\n			<div class=\"services-title\">\n				<h3>全方位互联网解决方案</h3>\n				<p>2015年已来，我们一直奉行专业、专心、专注、务实、创新的企业理念，以专业的素质、精湛的技术、高效的工作效率、一对一管家式的贴心服务赢得了广大企业客户的信赖！</p>\n			</div>\n			<div class=\"services1-content\">\n				<div class=\"column services-list-item\">\n					<a href=\"services-single.html\">\n						<video width=\"100%\" class=\"video\" loop=\"\" muted=\"\" poster=\"./assets/images/service_webdesign.jpg\">\n			                <source src=\"./assets/images/service_webdesign.mp4\" type=\"video/mp4\">\n			            </video>\n						<div class=\"service-info\">\n							<h4>网页设计与应用开发</h4>\n							<p>网站设计与开发 | 定制网站SEO | 定制网站优化 | 小程序设计与开发</p>\n						</div>\n					</a>\n				</div>\n				<div class=\"column services-list-item\">\n					<a href=\"services-single.html\">\n						<video width=\"100%\" class=\"video\" loop=\"\" muted=\"\" poster=\"./assets/images/service_branding.jpg\">\n							<source src=\"./assets/images/service_branding.mp4\" type=\"video/mp4\">\n						</video>\n						<div class=\"service-info\">\n							<h4>以结果为导向的数字营销</h4>\n							<p>数字营销策略 | 搜索引擎优化 | 社交和新媒体 | 软文内容营销</p>\n						</div>\n					</a>\n				</div>\n				<div class=\"column services-list-item\">\n					<a href=\"services-single.html\">\n						<video width=\"100%\" class=\"video\" loop=\"\" muted=\"\" poster=\"./assets/images/service_ecommerce.jpg\">\n							<source src=\"./assets/images/service_ecommerce.m4v\" type=\"video/mp4\">\n						</video>\n						<div class=\"service-info\">\n							<h4>全方位服务的电子商务</h4>\n							<p>电子商务设计 | 电子商务开发 | 电子商务SEO | 电子商务营销</p>\n						</div>\n					</a>\n				</div>\n			</div>\n		</div>\n	</div>\n</section>\n<script>\n    window.onload = function () {\n        const vids = document.getElementsByClassName(\'services-list-item\'); // Loop over the selected elements and add event listeners\n        for (let i = 0; i < vids.length; i++) {\n            let vidsItem = vids[i].querySelector(\'video\');\n            vids[i].addEventListener(\'mouseover\', function (e) {\n                vidsItem.play()\n            });\n            vids[i].addEventListener(\'mouseout\', function (e) {\n                vidsItem.pause()\n            })\n        }\n    }\n</script>\n<!-- //services 1 -->\n\n<!-- w3l-content-11 -->\n<section class=\"w3l-content-11\">\n	<div class=\"wrapper\">\n		<div class=\"section-title text-center\">\n			<h3>全渠道新零售解决方案</h3>\n		</div>\n		<div class=\"w3l-content-11-content\">\n			<div class=\"column content-text\">\n				<div class=\"content-text-left\">\n					<div class=\"columns\">\n						<span class=\"fa fa-shower\"></span>\n						<p> 全渠道:线上线下数据互通，满足消费者任何时间、任何地点、任何方式的购买需求，为消费者提供无差别的购物体验</p>\n					</div>\n					<div class=\"columns\">\n						<span class=\"fa fa-podcast\"></span>\n						<p>大数据:强大的数据整合处理能力，智能分析海量、高增长率和多样化的信息资产，实现消费者精准营销个性化服务</p>\n					</div>\n				</div>\n			</div>\n			<div class=\"column content-text\">\n				<div class=\"content-text-right\">\n					<div class=\"columns\">\n						<span class=\"fa fa-s15\"></span>\n						<p>新体验:PC端+移动端+体验店”三位一体，多样性互动体验，用户与商家深度联动。实现全网络全渠道、全平台的互通模式</p>\n					</div>\n					<div class=\"columns\">\n						<span class=\"fa fa-bed\"></span>\n						<p>智能物流:智能物流数字化管理，统一管理配送团队及整合发单商家和兼职配送人员，提升新零售物流配送服务管理</p>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</section>\n<!-- //w3l-content-11 -->\n\n<!-- companies20 -->\n<section class=\"companies-20\">\n	<div class=\"companies20\">\n		<div class=\"wrapper\">\n			<div class=\"section-title text-center\">\n				<h3>合作伙伴</h3>\n			</div>\n			<div class=\"companies20-content\">\n				<div class=\"companies-wrapper\">\n					<div class=\"owl-carousel owl-theme\">\n						<div class=\"item\">\n							<a href=\"#link\"><img src=\"assets/images/wechatpay.png\" width=\"100%\" alt=\"\" /></a>\n						</div>\n						<div class=\"item\">\n							<a href=\"#link\"><img src=\"assets/images/alipay.png\" width=\"100%\" alt=\"\" /></a>\n						</div>\n						<div class=\"item\">\n							<a href=\"#link\"><img src=\"assets/images/aliyun.png\" width=\"100%\" alt=\"\" /></a>\n						</div>\n						<div class=\"item\">\n							<a href=\"#link\"><img src=\"assets/images/baidu.png\" width=\"100%\" alt=\"\" /></a>\n						</div>\n						<div class=\"item\">\n							<a href=\"#link\"><img src=\"assets/images/tengxunyun.png\" width=\"100%\" alt=\"\" /></a>\n						</div>\n					</div>\n					<div class=\"text\">\n						<p>随着中国电子商务的不断发展，线上线下的边界已越来越模糊，线上线下融合则成为企业提升服务和营销的关键所在。实体店的体验和电商的便捷，两者彼此融合，借力使 力，使接线模糊，最终实现全渠道运营。汇聚所有线上线下销售路径和渠道，不漏掉任何一个潜在客户。</p>\n						<!-- a href=\"#link\" class=\"action\">Know More <span class=\"right\"></span> </a -->\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</section>\n<!-- //companies20 -->\n\n<script src=\"assets/js/jquery-3.3.1.min.js\"></script>\n<script src=\"assets/js/companies-20-owl.carousel.js\"></script>\n\n	<!-- script for companies 20 -->\n	<script>\n		$(document).ready(function () {\n			$(\'.owl-carousel\').owlCarousel({\n				loop: true,\n				margin: 0,\n				responsiveClass: true,\n				autoplay:true,\n				autoplayTimeout:2000,\n      			autoplaySpeed: 1000,\n				autoplayHoverPause:true,\n				responsive: {\n					0: {\n						items: 1,\n						nav: true\n					},\n					480: {\n						items: 2,\n						nav: true,\n						margin: 20\n					},\n					667: {\n						items: 2,\n						nav: true,\n						margin: 20\n					},\n					1000: {\n						items: 3,\n						nav: true,\n						margin: 20\n					}\n				}\n			})\n		})\n	</script>\n	<!-- //script for companies 20 -->\n	\n<!-- w3l-features-4 -->\n<section class=\"w3l-features-4\">\n    <div id=\"features4-block\">\n        <div class=\"wrapper\">\n            <div class=\"features4-grids d-grid text-center\">\n                <div class=\"features4-grid\">\n                   <span class=\"fa fa-certificate\"></span>\n                    <h5>我们注重落地与交付</h5>\n                    <p>新概念层出不穷，而概念和技术都只是辅助工具，企业问题定义不明确必然导致解决方案的不匹配，我们注重利用合适的方法与企业共同解决实际问题。</p>\n                </div>\n                <div class=\"features4-grid\">\n                    <span class=\"fa fa-users\"></span>\n                    <h5>我们倡导敏捷、快速迭代</h5>\n                    <p>我们注重交付，且不止于交付，我们着眼于企业发展的长期目标，并为之提供合理的迭代计划，帮助企业小步快跑，在持续迭代中不断挖掘商业价值。</p>\n                </div>\n                <div class=\"features4-grid\">\n                    <span class=\"fa fa-indent\"></span>\n                    <h5>我们是企业的信息化建设伙伴</h5>\n                    <p>我们具备专业的互联网技术能力并拥有丰富的项目经验，擅长将互联网技术与企业个性化业务场景相结